import React from 'react';
import './Ejournal.css';
import Switch from 'react-bootstrap/esm/Switch';
import { Route } from 'react-router-dom';
import { Tab } from './tab/ Tab.js';

const styles = {
    fontFamily: 'sans-serif',
  };

 export class Ejournal extends React.Component {
    constructor(props) {
      super(props);
      this.state = {active: 'aTab'};
    }
    render() {

      const  content = {
        aTab: <div className='Rectangle'
                   className='Box'        
        ></div>,
        bTab: <div className='Rectangle'></div>,
        cTab: <div className='Rectangle'></div>,
        dTab: <div className='Rectangle'></div>,
        eTab: <div className='Rectangle'></div>,
        fTab: <div className='Rectangle'></div>,
      };
      return (

            <>
        <br></br>  
        <br></br>
        <div className="App">
      <header className="App-header">

        <p>
          E-JOURNAL
        </p>
        </header>
        </div>
        <br></br>
        <br></br>
        <div style={styles}>

        <Tab
          active={this.state.active}
          onChange={active => this.setState({active})}
        >
          <span></span>
          <span></span>   
         <div key="aTab">MECHANICAL</div>
          <div key="bTab">ELECTRICAL</div>
          <div key="cTab">COMPUTER SCIENCE</div>
          <div key="dTab">BASIC SCIENCE</div>
          <div key="eTab">EMBEDDED SYSTEMS</div>
          <div key="fTab">ADDITIONAL</div>
        </Tab>

        <span></span>

      <br></br>
      <p>{content[this.state.active]}</p>
      </div>

      <Switch>
              <Route path="/tab">
                <Tab />
              </Route>
        </Switch>
  </>Â   

        )

    }
}
export default Ejournal;
